package Ch02;
//접근 한정자
//멤버, 클래스의 접근범위를 제한하기 위한 예약어
//public : 모든 클래스에서 접근가능
//private : 해당 클래스에만 접근간으
//protected: 상속 관계를 가지는 경우에 접근가능
//default : 동일 패키지에 속한 클래스에서 접근가능

class C01Person{
	
	
	String name;
	private int age;
	private String addr;
	
	
	//setter 함수 : 잠겨있는 함수 private한 함수를 수정할 때 사용
	
	//getter 함수 : 테이터를 외부로 반환 할 때 사용
	
	
                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   
	public int get(int age) {
		return this.age;
	}
	
	

	public String getName() {
		return name;
	}



	public void setName(String name) {
		this.name = name;
	}



	public String getAddr() {
		return addr;
	}



	public void setAddr(String addr) {
		this.addr = addr;
	}



	public void setAge(int age) {
		this.age = age;
	}
	public C01Person() {};
	public C01Person(String name, int age, String addr){
		super();
		this.name= name;
		this.age =age;
		this.addr=addr;
	}
	@Override
	public String toString() {
		return "C01Person [name=" + name + ", age=" + age + ", addr=" + addr + "]";
	}
}
public class C01정보은닉 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		C01Person person1 = new C01Person("손보금",28,"진주");
		person1.setAge(33);

	}

}
